{"contents":[{"channelVideoPlayerRenderer":{"videoId":"tLX3UcdxlPc","title":{"runs":[{"text":"And I’m not even close to being done #fashion #designer #pilates #fitness","navigationEndpoint":{"clickTrackingParams":"CIMEELsvGAAiEwjw4_LA1O2HAxXms5UCHfDiBBs=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=tLX3UcdxlPc","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"tLX3UcdxlPc","watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-5h25gvcg-8j2e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=b4b5f751c77194f7\u0026ip=177.67.157.112\u0026initcwndbps=732500\u0026mt=1723403578\u0026oweuc=\u0026pxtags=Cg4KAnR4Egg1MTIxOTc3MQ\u0026rxtags=Cg4KAnR4Egg1MTE5MTQ2MA%2CCg4KAnR4Egg1MTE5MTQ2MQ%2CCg4KAnR4Egg1MTE5MTQ2Mg%2CCg4KAnR4Egg1MTIxOTc3MQ"}}}}}}],"accessibility":{"accessibilityData":{"label":"And I’m not even close to being done #fashion #designer #pilates #fitness by blogilates 90,068,410 views 1 year ago 1 minute"}}},"description":{"runs":[{"text":"When it comes to really difficult decisions, I cannot ignore my heart. What I’ve learned is that my heart knows where I belong and what I’m meant to do. Oftentimes, I find my happiness after venturing into the hardest of decisions and the stickiest of messes. The best rewards often come with the biggest challenges.\n\nI can’t believe where I am today, and I’m not even close to where I want to be. And to be clear, I’m not not motivated by a dollar amount or the number or the number of followers. Unlike other companies who’s main goal is to sell or get investors, that’s not mine. My goal is to build a legacy brand with the best products that will live on after I die. My goal? Impact. I want grow and impact as many women as I can, while I can. To me, that’s the fun. That’s my motivation. You can ask Sam - I never look at the numbers. I’m purely excited by the creation process and then seeing you make my designs a part of your life. I LIVE for that. That is what fuels my 17 hour work days 7 days a week. Some may say I’m unhealthily addicted to my job but I don’t care what they say - what an absolute gift it is to be given the opportunity to have a career that aligns with my childhood dream, my passion and my mission. I feel lucky everyday.\n\nThis week I found out that @popflexactive made the "},{"text":"#INC5000","navigationEndpoint":{"clickTrackingParams":"CIMEELsvGAAiEwjw4_LA1O2HAxXms5UCHfDiBBs=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/inc5000","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gULCgdpbmM1MDAwGAE%3D"}}},{"text":" list 😳 We were named one of the fastest growing companies in North America. Apparently there are 33 million of them. \n\nAnd guess what? We’re just a tiny team. Made up of mostly women and Sam 🙂 I’m grateful for the opportunity to be surrounded with some of the kindest humans in the world: ideating, problem solving, and creating cool things every single day. From being days away from tossing out my brand and business a few years ago…to now this? Like I said, the most amazing things come after the toughest challenges.\n\nI’ve still got a lot of work to do though - especially finding peace with my parents. It’s a difficult, emotional subject and there is a section of my heart that is still numb with pain. I’ll figure it out one day.\n\n♥️Cassey"}]},"viewCountText":{"simpleText":"90,068,410 views"},"publishedTimeText":{"runs":[{"text":"1 year ago"}]},"readMoreText":{"runs":[{"text":"Read more","navigationEndpoint":{"clickTrackingParams":"CIMEELsvGAAiEwjw4_LA1O2HAxXms5UCHfDiBBs=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=tLX3UcdxlPc","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"video
